import React from 'react';
import ReactDOM from 'react-dom';
import './MenuItem.css'

class MenuItem extends React.Component {
  constructor(props){
    super(props);
  }
  render(){
    return( 
      <li className="nav-item px-1 col-12">
        <a className="nav-link txtHeader" href={this.props.item.url}>{this.props.item.title}</a>
      </li>
     );

  }
}

export default MenuItem;

